        {
            case 1:
                outputData = ObonCryptography.TripleDes.Decrypt(keyData, inputData, isHex);
                break;
            case 2:
        outputData = ObonCryptography.AES.Decrypt(keyData, inputData);
                break;
            case 3:
                outputData = ObonCryptography.MD5Hash.Hash(inputData);
